import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {
  title = 'Medicina Inmersiva';

}
<!doctype html>
<html lang="en" data-bs-theme="auto">
  <head><script src="/docs/5.3/assets/js/color-modes.js"></script>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <meta name="description" content="">
    <meta name="author" content="Mark Otto, Jacob Thornton, and Bootstrap contributors">
    <meta name="generator" content="Hugo 0.112.5">

    <link rel="canonical" href="https://getbootstrap.com/docs/5.3/examples/headers/">
<link href="/docs/5.3/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-9ndCyUaIbzAi2FUVXJi0CjmCapSmO7SnpJef0486qhLnuZ2cdeRhO02iuK6FUUVM" crossorigin="anonymous">

    <!-- Favicons -->
<link rel="apple-touch-icon" href="/docs/5.3/assets/img/favicons/apple-touch-icon.png" sizes="180x180">
<link rel="icon" href="/docs/5.3/assets/img/favicons/favicon-32x32.png" sizes="32x32" type="image/png">
<link rel="icon" href="/docs/5.3/assets/img/favicons/favicon-16x16.png" sizes="16x16" type="image/png">
<link rel="manifest" href="/docs/5.3/assets/img/favicons/manifest.json">
<link rel="mask-icon" href="/docs/5.3/assets/img/favicons/safari-pinned-tab.svg" color="#712cf9">
<link rel="icon" href="/docs/5.3/assets/img/favicons/favicon.ico">
<meta name="theme-color" content="#712cf9">


    <style>
      .bd-placeholder-img {
        font-size: 1.125rem;
        text-anchor: middle;
        -webkit-user-select: none;
        -moz-user-select: none;
        user-select: none;
      }

      @media (min-width: 768px) {
        .bd-placeholder-img-lg {
          font-size: 3.5rem;
        }
      }

      .b-example-divider {
        width: 100%;
        height: 3rem;
        background-color: rgba(0, 0, 0, .1);
        border: solid rgba(0, 0, 0, .15);
        border-width: 1px 0;
        box-shadow: inset 0 .5em 1.5em rgba(0, 0, 0, .1), inset 0 .125em .5em rgba(0, 0, 0, .15);
      }

      .b-example-vr {
        flex-shrink: 0;
        width: 1.5rem;
        height: 100vh;
      }

      .bi {
        vertical-align: -.125em;
        fill: currentColor;
      }

      .nav-scroller {
        position: relative;
        z-index: 2;
        height: 2.75rem;
        overflow-y: hidden;
      }

      .nav-scroller .nav {
        display: flex;
        flex-wrap: nowrap;
        padding-bottom: 1rem;
        margin-top: -1px;
        overflow-x: auto;
        text-align: center;
        white-space: nowrap;
        -webkit-overflow-scrolling: touch;
      }

      .btn-bd-primary {
        --bd-violet-bg: #712cf9;
        --bd-violet-rgb: 112.520718, 44.062154, 249.437846;

        --bs-btn-font-weight: 600;
        --bs-btn-color: var(--bs-white);
        --bs-btn-bg: var(--bd-violet-bg);
        --bs-btn-border-color: var(--bd-violet-bg);
        --bs-btn-hover-color: var(--bs-white);
        --bs-btn-hover-bg: #6528e0;
        --bs-btn-hover-border-color: #6528e0;
        --bs-btn-focus-shadow-rgb: var(--bd-violet-rgb);
        --bs-btn-active-color: var(--bs-btn-hover-color);
        --bs-btn-active-bg: #5a23c8;
        --bs-btn-active-border-color: #5a23c8;
      }
      .bd-mode-toggle {
        z-index: 1500;
      }
    </style>
    <!-- Custom styles for this template -->
  </head>
  <body>

<main>


  <!-- PARA HACER DIVISION -->
  <!--  <div class="b-example-divider"></div> -->


  <div class="container">
    <header class="d-flex flex-wrap align-items-center justify-content-center justify-content-md-between py-3 mb-4 border-bottom">
      <div class="col-md-3 mb-2 mb-md-0">
        <a href="/" class="d-inline-flex link-body-emphasis text-decoration-none">
          <img src="app/MedicinaInmersiva/Home/logo.png" >
        </a>
      </div>


      <ul class="nav col-12 col-md-auto mb-2 justify-content-center mb-md-0">
        <li><a href="#" class="nav-link px-2 link-secondary">INICIO</a></li>
        <li><a href="#" class="nav-link px-2">CONTENIDO</a></li>
        <li><a href="#" class="nav-link px-2">GLOSARIO</a></li>
      </ul>

      <div class="col-md-3 text-end">
        <button type="button" class="btn btn-outline-primary me-2">Cuenta</button>
      </div>
    </header>
  </div>

  <div class="b-example-divider"></div>

  <div class="p-4 p-md-5 mb-4 rounded text-body-emphasis bg-body-secondary">
    <div class="col-lg-6 px-0">
      <h1 class="display-4 fst-italic">ANATOMÍA HUMANA 3D</h1>
      <p class="lead my-3">Aumenta tu conocimiento sobre la antomía humana, gracias diversos recursos de estudio como muestras 3D, videos de anatomia, radiografías y dibujos. Dispones de un test rápido para poner a prueba tus conocimientos.</p>
      <p class="lead mb-0"><a href="#" class="text-body-emphasis fw-bold">Continue reading...</a></p>
    </div>
  </div>
  <hr>
  <p>¿Qué podemos encontrar?</p>

  <div class="container">
    <div class="row">
      <div class="col-sm-3">
        <div class="card">
          <img src="/src/" class="card-img-top" alt="">
          <div class="card-body">
            <h5 class="card-title">Radiografìas</h5>
            <p class="card-text">A través de radiografías, los estudiantes podrán examinar las diferentes partes del cuerpo humano y entender como están conectadas entre sí. Ayudando a una mejor comprensión a sus estudios.</p>
          </div>
        </div>
      </div>
      <div class="col-sm-3">
        <div class="card">
          <img src="..." class="card-img-top" alt="...">
          <div class="card-body">
            <h5 class="card-title">Muestras</h5>
            <p class="card-text">Gracias a las muestras 3D, los estudiantes pueden comprender de mejor manera la estructura del cuerpo humano, gracias a una representación visual y realista del cuerpo humano</p>
          </div>
        </div>
      </div>
      <div class="col-sm-3">
        <div class="card">
          <img src="..." class="card-img-top" alt="...">
          <div class="card-body">
            <h5 class="card-title">Videos Anatomìa</h5>
            <p class="card-text">Gracias a la accesibilidad de recursos visuales como videos, los estudiantes tendrán mas flexibilidad para su estudio, ya que, tendrán la posibilidad de pausar y rebobinar videos</p>
          </div>
        </div>
      </div>
      <div class="col-sm-3">
        <div class="card">
          <img src="..." class="card-img-top" alt="...">
          <div class="card-body">
            <h5 class="card-title">Imagenes 2D </h5>
            <p class="card-text">El uso de imágenes 2D, proporcionan una visualización clara y precisa de las diferentes partes del cuerpo humano. Además, gracias a un test rápido, brindando a los estudiantes un aprendizaje interactivo</p>
          </div>
        </div>
      </div>
    </div>
  </div>
